import { response } from "../../config/response.js";
import { status } from "../../config/response.status.js";

import { uploadProject } from "../services/project.service.js";

export const projectPost = async (req, res, next) => {
    console.log("게시글 작성을 요청하였습니다!"); // 테스트용1
    console.log("body:", req.body); // 테스트용2

    res.send(response(status.SUCCESS, await uploadProject(req.body)));
}

