import { BaseError } from "../../config/error.js";
import { status } from "../../config/response.status.js";
import { postResponseDTO } from "../dtos/project.dto.js"
import { postProject, getProject } from "../models/user.dao.js";

export const uploadProject = async (body) => {
    console.log("project.service.js 되나?");
    const uploadProjectData = await postProject({
        'user_id': 11,
        'name': body.name,
        'title': body.title,
